INSERT INTO `course` VALUES (4,'Творчество в Minecraft. Уровень 1. Компьютерная грамотность','Курс предназначен для детей, которые пока еще плохо управляются с компьютером, зато уже знают, что такое Minecraft. На занятиях с помощью платформы Minecraft и специального тренажера ученики изучат основные программы ПК, базовые понятия векторной графики, базу алгоритмики и основы геометрии. Используя новые знания, каждый ребенок подготовит свой первый чертеж и алгоритмическую программу.','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(5,'Творчество в Minecraft. Уровень 3. 3D-моделирование и дизайн','На этом курсе дети осваивают 3D-моделирование, дизайн и программирование, создавая при этом свою оригинальную версию игры. Цель каждого ребенка — построить свой уникальный проект: город или парк мечты. Для этого ребята изучат правила построения 3D-объектов в редакторе Tinkercad, познакомятся с основами дизайна и правилами цветовой палитры для создания своих игровых текстур, на базовом уровне освоят Photoshop. Ребенок сможет применить полученные знания для создания своей версии игры Minecraft, а также в учебе и профессиональном развитии. \r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(6,'Творчество в Minecraft. Уровень 2. Квест','Обучение детей на данном курсе проходит в формате игрового квеста в Minecraft. Для успешного выполнения командного задания ученики изучают и создают алгоритмы, знакомятся с логическими системами (триггерами), проектируют и создают карты на прохождение внутри Minecraft. Все задачи, которые предстоит решить ученикам, обыгрываются с помощью наглядных сюжетов: например, для общения с туземцами ребятам нужно создать алгоритм.','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(7,'Создание игр на Scratch. Уровень 1. Основы','На этом курсе ученики начинают программировать первые игры, используя специальный визуальный язык Scratch. На занятиях ребенок сам придумает механику, сюжет, героев и соберет настоящую игру, используя Scratch. Во время курса ребята под руководством преподавателя создадут 6 тренировочных проектов: «Танки» для двух игроков, Angry Birds с реалистичной физикой, классический арканоид, игры в жанре «стрелялки», игры по сбору бонусов с подсчетом очков.','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(8,'Создание игр на Scratch. Уровень 2. Игровая логика','Курс предназначен для детей, которые уже знакомы с языком Scratch, но хотят прокачать свои навыки программирования и стать настоящими гуру. Занятия проходят в формате проектной работы: ребенок будет делать одну сложную логическую или графическую 2D-игру выбранного жанра. Для разработки игр ребята изучат математические функции и научатся выстраивать многоуровневые логические связи, чтобы писать алгоритмы. Проект будет проходить несколько основных этапов: проектирование, разработка, тестирование.\r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(9,'Программирование в Minecraft. Уровень 1. Основы \r\n','На этом курсе ребята в игровой форме изучат основы программирования, узнают понятия переменных, циклов и операторов. На занятиях используется обучающая модификация игры Minecraft, в которой можно создавать свои программы с помощью визуальных блоков, похожих на конструктор. Каждый ребенок сделает свою программу, благодаря которой его герой сможет выполнять нужные команды. Такая работа здорово прокачает навыки алгоритмического и пространственного мышления.\r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(10,'Программирование в Minecraft. Уровень 2. JavaScript\r\n','Ключевая задача курса — изучение языка JavaScript, знакомство с принципами работы удаленного сервера и редактора кода. Ребята научатся писать код игры, создадут сервер и несколько плагинов для него. Для этого детям предстоит изучить массивы, циклы, объекты и прочие структуры в JavaScript. Каждый ребенок напишет собственную программу с использованием специального объекта, который позволяет мгновенно построить здание или конструкцию. Дети узнают, как получить доступ к скрытым от обычного игрока файлам и настройкам игры, научатся взаимодействовать с сервером Minecraft и смогут сразу же увидеть результаты своей работы в игровом мире.\r\n\r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(11,'Программирование в Minecraft. Уровень 3. Профи. Мини-игры \r\n','Чтобы создать свою мини-игру, ребятам придется разобраться в архитектуре компьютера и стать почти что системным администраторами. Дети продолжат изучать язык JavaScript и познакомятся с новыми командами. Они узнают, как устроен сервер, начнут работу с плагинами, а также напишут свои двойные и тройные массивы. Объединившись в команды, дети создадут на общем сервере собственный игровой проект. \r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(12,'Создание игр на Unity. Уровень 1. Основы\r\n','На этом курсе ребята создают свои первые игровые проекты, используя популярный язык C# и движок Unity. Они учатся создавать линейные и нелинейные алгоритмы, писать код на C#, а также на примере движка Unity получают представление о том, как устроены разные программы. Каждые два занятия дети создают новый проект, прорабатывая при этом определенные навыки программирования. Опыт, который ребенок получит на курсе, может пригодиться при создании школьного или внеклассного проекта.\r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(13,'Создание игр на Unity. Уровень 2. Приложение для смартфона','Дети продолжают погружаться в разработку игр на платформе Unity. На этот раз цель каждого ребенка — собрать собственное игровое приложение. Для этого дети создают меню и элементы управления в игре, а также учатся подключать схему управления для сенсорного экрана смартфона. Они пишут сложный код, изучают процедуры и функции, понимают, из каких элементов кода состоит любой игровой проект. Это позволяет более свободно экспериментировать и смотреть, как конкретный код влияет на промежуточный результат. \r\n\r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(14,'Создание игр на Unity. Уровень 3. Профи. VR','Курс для тех, кто на волне новых технологий. Обучение на курсе позволит сильно расширить возможности в работе с движком Unity. Ребенок научится создавать графику, подключать дополнительные модули и настраивать анимацию. Управление в игре, которую напишет каждый ребенок, будет осуществляться взглядом. Чтобы не ограничивать фантазию детей при создании проектов, им будет предложена большая база графических материалов. Также каждому ребенку будет предоставлен шлем виртуальной реальности.\r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(15,'Создание игр на Unity. Уровень 4. Профи. Создание игровых миров \r\n','На этом курсе начинается настоящее «недетское» программирование. Ребята узнают разницу между процедурным и объектно-ориентированным подходами и используют их оба для решения разных задач в одном одном игровом проекте. Каждый ребенок напишет свою игру в популярном жанре «открытый мир», когда игрок свободно перемещается по карте и самостоятельно выбирает разные задания. Теперь ребята будут создавать мир не графически, а автоматически — с помощью специальных компонентов и настроек. В свой мир дети смогут добавлять любые объекты — готовые из библиотеки или созданные самостоятельно в графическом редакторе. В конце курса, все миры, созданные на занятиях, будут собраны в единую солнечную систему.\r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(16,'Разработка и дизайн сайтов. Уровень 1. Основы HTML и CSS','Курс предназначен для обучения основам создания сайтов и знакомству с главными техническими понятиями в интернете. Ребята получат базовые навыки разработки с использованием HTML и CSS. Ученики будут пользоваться популярными инструментами написания кода и работы с файлами на FTP сервере, а также коснутся процесса проектирования структуры и подготовки контента для сайта. ','',8,22000,NULL,NULL),(21,'Дизайн и анимация в играх. Уровень 1.										','','',8,22000,NULL,NULL),(22,'Создание игр: математика и логика. Уровень 1','','',8,22000,NULL,NULL),(23,'Python. Игры','В рамках курса дети познакомятся с одним из самых популярных языков программирования и узнают его структуру, подключат несколько библиотек по созданию игр и познакомятся с общей моделью конструирования игры. \r\n\r\nНавыки: логика, базовый python, понимание создания игры. \r\nРезультат: создание своей игры для ПК. \r\nЗАПИСАТЬСЯ\r\n','',8,NULL,NULL,NULL),(24,'Создание сайта на JavaScript','В этом курсе ребята познакомятся со структурой создания сайта, со всеми его сов этом курсе ребята познакомятся с структурой создания сайта, со всеми его составляющими, будут использовать html-верстку, css-стили, а после подключат Java script и узнают про его возможности. \r\n\r\nНавыки: язык верстки, подключение css и js синхронизация компонентов сайта, модель построения сайта (веб-приложения). \r\nРезультат: создание своего сайт с уникальным дизайном. ','',8,NULL,NULL,NULL),(25,'Создание бота в Telegram/ВКонтакте на Python','Обучение азам программирования на Python, понимание структуры клиент-сервер, понятие и взаимодействие с API. \r\n\r\nНавыки: работа над веб-проектами, программирование на Python. \r\nРезультат: создание бота с уникальным набором инструкций. ','',8,NULL,NULL,NULL),(26,'Создание игр на Unity. VR','Ребята научатся создавать приложения виртуальной реальности на Unity, познакомятся с разработкой для VR, графическими возможностями Unity, создание нескольких прототипов игры для VR. На занятиях ученики самостоятельно настроят взаимодействие взглядом с игровым миром с помощью VR-шлема, а также добавят в прототипы более сложные игровые механики и графику. \r\n\r\nНавыки: создание VR-приложения, работа с Unity и C#, анимация в Unity. \r\nРезультат: сборка и презентация собственного VR-проекта с уникальными элементами программного кода. ','',NULL,NULL,NULL,NULL),(27,'Разработка и дизайн сайтов. Основы HTML и CSS','В этом курсе ребята познакомятся со структурой создания сайта, со всеми его сов этом курсе ребята познакомятся с структурой создания сайта, со всеми его составляющими, будут использовать HTML-верстку, cssстили, а после подключат Java script и узнают про его возможности. \r\n\r\nНавыки: язык верстки, подключение CSS и JS синхронизация компонентов сайта, модель построения сайта (веб-приложения). \r\nРезультат: создание своего сайта с уникальным дизайном. ','',NULL,NULL,NULL,NULL),(28,'Городской лагерь. Создание стикеров для мессенджеров','На смене ребята изучат основы дизайна и работы в Adobe Photoshop, создадут своих оригинальных персонажей и разовьют в себе творческие навыки. Цель курса — научиться работать со сложным графическим редактором и изучить основы создания персонажа, путем разработки собственных стикеров. К концу смены каждый ребенок сделает свой стикерпак и опубликует его в Telegram.','',5,18900,NULL,NULL),(29,'Создание игр: математика и логика','Курс для юных программистов, в котором основное внимание уделяется математике и логике. На примере различных игровых механик ребята узнают важные математические приемы, которые не только помогут им отлично справляться на уроках математики в школе, но и дадут возможность в дальнейшем с легкостью освоить новые более сложные языки программирования. \r\n\r\nНа каждом занятии дети будут изучать разные темы из математики и информатики на примере создания простых (и не очень) игровых ситуаций на языке Scratch, которые потом ребенок сможет использовать для создания собственной игры в конце курса. \r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,20000,NULL,NULL),(30,'Дизайн и анимация в играх','Создание игр - очень разносторонний процесс, в котором принимают участие не только программисты, но и люди многих других профессий. Мы создали курс, рассчитанный на творческих ребят 6-9 лет, включающий в себя основы графического дизайна, геймдизайна и UX-дизайна (дизайн интерфейса), а также основы драматургии и анимации.\r\n\r\nScratch - в курсе используется для создания персонажа и анимации, а так же простейшего скриптинга, реализующего эту анимацию. \r\nStencyl - игровой конструктор. Используется в курсе для дизайна уровней и элементов интерфейса.\r\n','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,20000,NULL,NULL),(32,'Монтаж своего видеоролика для YouTube (лагерь)','Курс молодого бойца для юных клипмейкеров. Здесь ребята не только научатся работать в Adobe Premiere Pro - одной из популярнейших профессиональных программ для редактирования видео, но и научатся подходить к монтажу как к мощному творческому инструменту. В курсе используются теоретические знания уровня высших творческих школ, которые обычно не включаются в уроки по монтажу, размещаемые в интернете. По окончании курса, используя полученные знания, ребенок создаст собственный видеоролик и загрузит его на Youtube.\r\n','',5,NULL,NULL,NULL),(33,'Кибербезопасность (лагерь)','Это смена-квест погружает ребят в запутанную историю исчезновения человека, которого срочно нужно найти. Однако у нас есть только его страничка в социальной сети. Ребята поймут, как зашифровать любую информацию, как её восстановить, если она была удалена, как получить удаленный доступ к компьютеру, как скрыть секретное послание в картинке или музыке, а также познакомятся с возможностями языка Python.','',5,NULL,NULL,NULL),(34,'Создание игр в AR (лагерь)','Данный лагерь предполагает изучение детьми такого инструмента как Vuforia (бесплатный SDK для работы с дополненной реальностью) на основе его интеграции с Unity и разработкой приложения с использованием технологии AR под мобильные устройства. Лагерь рассчитан на детей 10-13 лет, которые хотят научиться создавать приложения, использующие технологию дополненной реальности.','',5,NULL,NULL,NULL),(35,'Создание стикеров для мессенджеров (лагерь)','На смене ребята изучат основы дизайна и работы в Adobe Photoshop, создадут своих оригинальных персонажей и разовьют в себе творческие навыки. Цель курса - научиться работать со сложным графическим редактором и изучить основы создания персонажа, путем разработки собственных стикеров.К концу смены каждый ребенок сделает свой стикерпак и опубликует его в Telegram.\r\n','',5,NULL,NULL,NULL),(36,'Разработчик в Minecraft (лагерь)','Ключевая задача лагеря — изучение языка JavaScript, знакомство с принципами работы удаленного сервера и редактора кода. Каждый ребенок напишет собственную программу с использованием специального объекта, который позволяет мгновенно построить здание или конструкцию. Дети узнают, как получить доступ к скрытым от обычного игрока файлам и настройкам игры, научатся взаимодействовать с сервером Minecraft и смогут сразу же увидеть результаты своей работы в игровом мире.\r\n','',5,NULL,NULL,NULL),(37,'Разработка игр на Python (лагерь)','На занятиях дети овладеют основами программирования на языке Python, научатся работать с встроенными модулями Python 2.7. Цель участников лагеря - создать собственную 2D-игру при помощи скриптов. В процессе обучения дети научатся построению базовых алгоритмов, освоят понятия функций, переменных, условий, циклов, а также познакомятся с основами объектно-ориентированного программирования и пользовательских интерфейсов. Каждый участник представит свой проект в формате программы-игры, оснащенной уникальным UI.\r\n','',5,NULL,NULL,NULL),(38,'Программирование и электроника Raspberry Pi + Minecraft (лагерь)','Смена по программированию и работе с электроникой для юных любителей игры Minecraft. В лагере ребята познакомятся с микрокомпьютером Raspberry Pi и узнают, как управлять объектами в Minecraft с помощью языка программирования Python. Участники овладеют специальными инструментами языка, что позволит им дополнить код игры и создавать свой мир без ручного строительства.\r\n\r\nMinecraft PI Edition разработан для обучения детей программированию и элементарному конструированию. Это отличная возможность заинтересовать ребенка программированием, увлечь математикой и электроникой.\r\n','',5,NULL,NULL,NULL),(39,'Создание игр: математика и логика (лагерь)','Лагерь предназначен для ребят 7-10 лет и призван познакомить их с темами математики и информатики из школьной программы более старших классов на понятных игровых примерах. Занятия проходят в программе Scratch, позволяющей создавать игровые проекты на блоковом языке программирования. После смены дети не только смогут разбираться в этих темах лучше всех в классе, но и увидят практическую применимость математических знаний. Всё это вместе с базовыми знаниями по алгоритмике и программированию позволит ребенку создать в конце смены свою собственную игру с нуля. \r\n','',5,NULL,NULL,NULL),(40,'Дизайн и анимация в играх (лагерь)','Смена предназначена для творческих ребят 6-9 лет и включает в себя основы различных ответвлений дизайна. Узнав основы графического дизайна и анимации, ребята создадут и анимируют своего персонажа в программе Scratch. Затем персонаж будет перенесет в другую программу - Stencyl - где, узнав основы драматургии и геймдизайна, ребята разработают собственные игровые уровни, по которым персонаж сможет перемещаться. В конце к каждой игре будет добавлено стартовое меню, созданное также не без теории - здесь это основы дизайна интерфейса. По итогу у ребенка будет концепт игры а также понимание, как создавать проект, смотря на него глазами не только разработчика, но и пользователя.\r\n','',5,NULL,NULL,NULL),(41,'Создание игр в AR (лагерь) ','Данный лагерь предполагает изучение детьми такого инструмента как Vuforia (бесплатный SDK для работы с дополненной реальностью) на основе его интеграции с Unity и разработкой приложения с использованием технологии AR под мобильные устройства. Лагерь рассчитан на детей 10-13 лет, которые хотят научиться создавать приложения, использующие технологию дополненной реальности.','',NULL,NULL,NULL,NULL),(42,'Создание стикеров для мессенджеров (лагерь) ','На смене ребята изучат основы дизайна и работы в Adobe Photoshop, создадут своих оригинальных персонажей и разовьют в себе творческие навыки. Цель курса - научиться работать со сложным графическим редактором и изучить основы создания персонажа, путем разработки собственных стикеров.К концу смены каждый ребенок сделает свой стикерпак и опубликует его в Telegram','',NULL,NULL,NULL,NULL),(43,'Разработчик в Minecraft (лагерь) ','Ключевая задача лагеря — изучение языка JavaScript, знакомство с принципами работы удаленного сервера и редактора кода. Каждый ребенок напишет собственную программу с использованием специального объекта, который позволяет мгновенно построить здание или конструкцию. Дети узнают, как получить доступ к скрытым от обычного игрока файлам и настройкам игры, научатся взаимодействовать с сервером Minecraft и смогут сразу же увидеть результаты своей работы в игровом мире','',NULL,NULL,NULL,NULL),(44,'Монтаж своего видеоролика для YouTube (лагерь)','Курс молодого бойца для юных клипмейкеров. Здесь ребята не только научатся работать в Adobe Premiere Pro - одной из популярнейших профессиональных программ для редактирования видео, но и научатся подходить к монтажу как к мощному творческому инструменту. В курсе используются теоретические знания уровня высших творческих школ, которые обычно не включаются в уроки по монтажу, размещаемые в интернете. По окончании курса, используя полученные знания, ребенок создаст собственный видеоролик и загрузит его на