чно найти пропавшего человека, используя его страницу в социальной сети и удаленный доступ к компьютеру. Также ребята узнают, как скрывать секретные послания в картинке и даже в музыке.','',NULL,NULL,NULL,NULL),(48,'Дизайн и анимация в играх (лагерь)','Смена предназначена для творческих ребят 6-9 лет и включает в себя основы различных ответвлений дизайна. Узнав основы графического дизайна и анимации, ребята создадут и анимируют своего персонажа в программе Scratch. Затем персонаж будет перенесет в другую программу - Stencyl - где, узнав основы драматургии и геймдизайна, ребята разработают собственные игровые уровни, по которым персонаж сможет перемещаться. В конце к каждой игре будет добавлено стартовое меню, созданное также не без теории - здесь это основы дизайна интерфейса. По итогу у ребенка будет концепт игры а также понимание, как создавать проект, смотря на него глазами не только разработчика, но и пользователя.','',NULL,NULL,NULL,NULL),(49,'Разработка игр на Python (лагерь)','На занятиях дети овладеют основами программирования на языке Python, научатся работать с встроенными модулями Python 2.7. Цель участников лагеря - создать собственную 2D-игру при помощи скриптов. В процессе обучения дети научатся построению базовых алгоритмов, освоят понятия функций, переменных, условий, циклов, а также познакомятся с основами объектно-ориентированного программирования и пользовательских интерфейсов. Каждый участник представит свой проект в формате программы-игры, оснащенной уникальным UI.','',NULL,NULL,NULL,NULL),(50,'Minecraft 3D-моделирование и дизайн (лагерь)','На смене дети научатся 3D-моделированию и дизайну, чтобы сделать свою оригинальную версию игры. Цель каждого участника - построить свой уникальный проект, город или парк мечты, но ничего строить вручную не надо. Для этого ребята изучат правила построения 3D-объектов, используя редактор Tinkercad, познакомятся с основами дизайна и правилами цветовой палитры, чтобы создать свои игровые текстуры.\r\n','',5,NULL,NULL,NULL),(51,'Minecraft 3D-моделирование и дизайн (лагерь)','На смене дети научатся 3D-моделированию и дизайну, чтобы сделать свою оригинальную версию игры. Цель каждого участника - построить свой уникальный проект, город или парк мечты, но ничего строить вручную не надо. Для этого ребята изучат правила построения 3D-объектов, используя редактор Tinkercad, познакомятся с основами дизайна и правилами цветовой палитры, чтобы создать свои игровые текстуры.','',NULL,NULL,NULL,NULL),(52,'ДеньОткрытых Дверей','','',NULL,NULL,NULL,NULL),(53,'Дне Открытых Дверей','','',NULL,NULL,NULL,NULL),(55,'Unity. Создание игр. Уровень 1. Основа','Unity — взрослый инструмент для разработки игр и приложений, с помощью которого ребенок создаст собственную игру. Для этого он изучит основы языка программирования С#, узнает, как и зачем реализована физическая модель и освоит компонентную систему движка. Результатом станет готовая игра для Windows и Mac OC.','',8,12000,NULL,NULL),(56,'Создание игр на Scratch. Уровень 1.','Курс рассчитан на ребят 7-10 лет, не имеющих предварительного опыта в программировании. Задачи курса познакомить детей с основами работы в Scratch - структурой языка, основными алгоритмическими конструкциями и приемами решения тривиальных задач. Развить у учеников алгоритмическое мышление и навыки составления собственных алгоритмов. Познакомить с основами проектирования программ. В конце курса реализовать собственный игровой проект на языке Scratch, продуманный каждым учеником самостоятельно.','',8,12000,NULL,NULL),(57,'Программирование в Minecraft (лагерь)','На смене дети научатся основам программирования, чтобы сделать свою первую программу. В ходе создания своего проекта ребята познакомятся с условными операторами, переменными, циклами, научатся создавать свои программы, которые помогут в игровом мире. ','',5,13900,NULL,NULL),(58,'Создание игр: математика и логика (лагерь)','Лагерь предназначен для ребят 7-10 лет и призван познакомить их с темами математики и информатики из школьной программы более старших классов на понятных игровых примерах. Занятия проходят в программе Scratch, позволяющей создавать игровые проекты на блоковом языке программирования. После смены дети не только смогут разбираться в этих темах лучше всех в классе, но и увидят практическую применимость математических знаний. Всё это вместе с базовыми знаниями по алгоритмике и программированию позволит ребенку создать в конце смены свою собственную игру с нуля. ','',5,13900,NULL,NULL),(59,'Создание игр на Unity. Основы (лагерь)','Смена предназначена для знакомства с движком Unity и освоения базовых навыков  проектирования игр  и программирования на C#: дети получат представление об архитектуре программных компонентов Unity, освоят основы построения линейных и нелинейных алгоритмов, научатся писать код, направленный на решение конкретных задач. Таким образом каждый ученик создает свою работающую версию игры. ','',5,13900,NULL,NULL),(60,'Разработка и дизайн сайтов. Основы HTML и CSS (лагерь)','Курс будет интересен всем, кто хочет научиться создавать свои сайты с нуля. Ребята будут писать код в профессиональной среде разработки, поймут, как устроены сайты, получат необходимые навыки для самостоятельной работы. Дети будут изучать язык гипертекстовой разметки (HTML) и каскадные таблицы стилей (CSS), а также примерят на себя роль Веб-дизайнера.','',5,13900,NULL,NULL),(61,'День открытых дверей (старт)','Открытие Первой школы программирования и цифрового творчества  Кодабра в Новосибирске. В программе - бесплатные мастер-классы для ребенка. Ребенок попробуем свои силы в ИТ, выполняя небольшое задание из интересного ему курса и создаст небольшой фрагмент игры. Для родителей - презентация Школы, программ, примеры работ детей из других регионов, презентация работ ребят - участников ДОД.','',2,NULL,NULL,NULL),(62,'День открытых дверей - Атмосфера','','',2,NULL,NULL,NULL),(63,'Дне Открытых Дверей','','',NULL,NULL,NULL,NULL),(64,'Разработка и дизайн сайтов. Основы HTML и CSS','','',5,13900,NULL,NULL),(65,'Создание игр на Unity','На этом интенсивном курсе ребята создают свои первые игровые проекты, используя популярный язык C# и движок Unity. Они учатся создавать линейные и нелинейные алгоритмы, писать код на C#, а также на примере движка Unity получают представление о том, как устроены разные программы. Каждые два занятия дети создают новый проект, прорабатывая при этом определенные навыки программирования. Опыт, который ребенок получит на курсе, может пригодиться при создании школьного или внеклассного проекта.','',5,16900,NULL,NULL),(66,'Разработка игр на Python','На курсе дети изучат основы программирования на языке Python, научатся работать с встроенными модулями Python 2.7. Цель участников курса - создать собственную 2D-игру при помощи скриптов. В процессе обучения дети научатся построению базовых алгоритмов, освоят понятия функций, переменных, условий, циклов, а также познакомятся с основами объектно-ориентированного программирования и пользовательских интерфейсов. Каждый участник представит свой проект в формате программы-игры, оснащенной уникальным UI.','',8,20900,NULL,NULL),(67,'Разработка и дизайн сайтов. Основы HTML, CSS и JavaScript','Курс будет интересен всем, кто хочет научиться создавать свои сайты с нуля. Ребята будут писать код в профессиональной среде разработки, поймут, как устроены сайты, получат необходимые навыки для самостоятельной работы. Дети будут изучать язык гипертекстовой разметки (HTML), каскадные таблицы стилей (CSS) и самый востребованный язык программирования JavaScript в связке с фреймворком jQuery.','',8,20900,NULL,NULL),(68,'Разработка нейронной сети на Python','На интенсиве дети изучат основы программирования на языке Python, изучат основы построения нейронных сетей и научатся их использовать. Цель курса - узнать, что такое нейронная сеть, познакомиться с устройством нейросетей и научиться их использовать. Основная задача курса - запрограммировать нейронную сеть, способную распознавать изображения и генерировать описания к ним. В процессе обучения дети освоят базовые понятия алгоритмов, способы хранения данных, принципы «взрослого» функционального программирования; научатся использовать библиотеки языка Python - NumPy и TensorFlow; узнают, как работает машинное обучение и нейросети; научатся использовать их для решения прикладных задач.','',8,NULL,NULL,NULL),(70,'Разработка и дизайн сайтов. Уровень 1. Основы HTML и CSS (лагерь) ','Курс предназначен для обучения основам создания сайтов и знакомству с главными техническими понятиями в интернете. Ребята получат базовые навыки разработки с использованием HTML и CSS. Ученики будут пользоваться популярными инструментами написания кода и работы с файлами на FTP сервере, а также коснутся процесса проектирования структуры и подготовки контента для сайта.','',5,NULL,NULL,NULL),(71,'Создание игр на Unity. Основы. (Лагерь) ','На этом курсе ребята создают свои первые игровые проекты, используя популярный язык C# и движок Unity. Они учатся создавать линейные и нелинейные алгоритмы, писать код на C#, а также на примере движка Unity получают представление о том, как устроены разные программы. Каждые два занятия дети создают новый проект, прорабатывая при этом определенные навыки программирования. Опыт, который ребенок получит на курсе, может пригодиться при создании школьного или внеклассного проекта.','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,22000,NULL,NULL),(72,'Программирование в Minecraft. Основы. (Лагерь)','На этом курсе ребята в игровой форме изучат основы программирования, узнают понятия переменных, циклов и операторов. На занятиях используется обучающая модификация игры Minecraft, в которой можно создавать свои программы с помощью визуальных блоков, похожих на конструктор. Каждый ребенок сделает свою программу, благодаря которой его герой сможет выполнять нужные команды. Такая работа здорово прокачает навыки алгоритмического и пространственного мышления.','https://docs.google.com/document/d/1ZhQtOgTqhDXT2ncQTMXEzkHxWywzdPpTdEEIADcKqSk/edit#',8,NULL,NULL,NULL),(73,'Создание игр на Python','','',8,NULL,NULL,NULL),(74,'Создание игр на Python','','',8,NULL,NULL,NULL);
